import React from 'react'

function Homelogo({ props}) {
    return (
        <div className="homepage" >
            
               {<div className="logodiv">{props.icon}</div>}
               <div style={{marginLeft:'10px'}}>
            <h4>{props.tittle}</h4>
            </div>
        </div>
    )
}

export default Homelogo
